import React from 'react'
import { Link } from 'react-router-dom'

const UserSideNav = () => {
  return (
    <div className='All-admin-side'>
        <Link to="/admin/allorder" style={{textDecoration:'none'}}><div className='admin-side-nav-methoude' >Order Management</div></Link>
        <Link to="/admin/allproduct" style={{textDecoration:'none'}}><div className='admin-side-nav-methoude'>Favorite List</div></Link>
        <Link to="/admin/addbrand" style={{textDecoration:'none'}}><div className='admin-side-nav-methoude'>personal address</div></Link>
        <Link to="/admin/addcategory" style={{textDecoration:'none'}}><div className='admin-side-nav-methoude'>Add Rating</div></Link>
       
    </div>
  )
}

export default UserSideNav
